import React from "react";
import "../styles/Navbar.css";
import { endianness } from "os";

// By importing the Navbar.css file, it is added to the DOM whenever this component loads

function Navbar() {
  return (
    <nav className="navbar">
      <a href="/">Welcome</a>
    </nav>
  );
}

const styles = {

 card: {
   margin: 20,
   background: "green",
   justify: "flex-end",
 },
 heading:{
   background: "#9a74db",
   minHeight:50,
   lineHeight: 3.5,
   fontSize: "1.2rem",
   color: "white",
   padding: "0 20px"
 }
  };

export default Navbar;
